import { FunctionComponent, useEffect, useState } from 'react';
import { CertsApi, RolAttApi } from '@helpers/request';
import { useHistory } from 'react-router-dom';
import { handleRequestError } from '@helpers/utils';
import { Row, Col, Form, Input, Modal, Select, Button, Upload, Image } from 'antd';
import { ExclamationCircleOutlined, UploadOutlined, ExclamationOutlined } from '@ant-design/icons';
import Header from '@antdComponents/Header';
import BackTop from '@antdComponents/BackTop';
import ReactQuill from 'react-quill';
import EviusReactQuill from '../shared/eviusReactQuill';
import { toolbarEditor } from '@helpers/constants';
import dayjs from 'dayjs';
import { firestore } from '@helpers/firebase';
import { withRouter } from 'react-router-dom';
import { DispatchMessageService } from '@context/MessageService';

const { confirm } = Modal;
const { Option } = Select;

const formLayout = {
  labelCol: { span: 24 },
  wrapperCol: { span: 24 },
};

const initContent =
  '<p><br></p><p><br></p><p>Certificamos que</p><p>[user.names],</p><p>participo con éxito el curso</p><p>[event.name]</p><p>realizado del [event.start] al [event.end].'; /* </p><p>[event.venue], información.</p> */

const imageFile =
  'data:image/png;base64,';

const CertificateEditor: FunctionComponent<any> = (props) => {
  const locationState = props.location.state; //si viene new o edit en el state, si es edit es un id
  const history = useHistory();
  const [certificado, setCertificado] = useState<any>({
    content: initContent,
    imageFile: imageFile,
    imageData: imageFile,
    image: imageFile,
  });
  const [roles, setRoles] = useState<any[]>([]);
  const [rol, setRol] = useState<any>({});
  const [previewCert, setPreviewCert] = useState<any>({});

  const tags = [
    { tag: 'event.name', label: 'Nombre del curso', value: 'name' },
    { tag: 'event.start', label: 'Fecha inicio del curso', value: 'datetime_from' },
    { tag: 'event.end', label: 'Fecha fin del curso', value: 'datetime_to' },
    { tag: 'event.venue', label: 'Lugar del curso', value: 'venue' },
    { tag: 'event.address', label: 'Dirección del curso', value: 'location.FormattedAddress' },
    { tag: 'user.names', label: 'Nombre(s) de asistente', value: 'names' },
    { tag: 'user.email', label: 'Correo de asistente', value: 'email' },
    { tag: 'ticket.name', label: 'Nombre del tiquete', value: 'ticket.title' },
    { tag: 'rol.name', label: 'Nombre del Rol' },
  ];

  useEffect(() => {
    // If the component is rendered to edit, then we have to get the data
    if (locationState.edit) {
      getOne();
    }

    // Get all roles
    getRoles();
  }, [locationState.edit]);

  const getOne = async () => {
    const data = await CertsApi.getOne(locationState.edit);
    if (!data.content && data.content === '<p><br></p>') {
      setCertificado({ ...data, content: initContent });
    }

    setCertificado({ ...data, imageFile: data.background });
    setCertificado({ ...data, imageFile: data.background });
  };

  const onSubmit = async () => {
    if (certificado.name) {
      // && certificado.rol
      DispatchMessageService({
        type: 'loading',
        key: 'loading',
        msj: 'Por favor espere mientras se guarda la información...',
        action: 'show',
      });

      try {
        if (locationState.edit) {
          const data = {
            name: certificado.name,
            content: certificado.content,
            background: certificado.image?.data || certificado.image,
            rol: certificado?.rol,
            rol_id: certificado.rol?._id,
            event_id: props.event._id,
          };
          await CertsApi.editOne(data, locationState.edit);
          /* console.log(data) */
        } else {
          const data = {
            name: certificado.name,
            rol_id: certificado.rol?._id,
            content: certificado.content,
            event_id: props.event._id,
            background: certificado.image?.data || certificado.image,
            rol: certificado?.rol,
          };
          await CertsApi.create(data);
        }

        DispatchMessageService({
          key: 'loading',
          action: 'destroy',
        });

        DispatchMessageService({
          type: 'success',
          msj: 'Información guardada correctamente!',
          action: 'show',
        });

        history.push(`${props.matchUrl}`);
      } catch (e) {
        DispatchMessageService({
          key: 'loading',
          action: 'destroy',
        });

        DispatchMessageService({
          type: 'error',
          msj: handleRequestError(e).message,
          action: 'show',
        });
      }
    } else {
      // y el rol son
      DispatchMessageService({
        type: 'error',
        msj: 'El nombre es requerido',
        action: 'show',
      });
    }
  };

  const onRemoveId = () => {
    DispatchMessageService({
      type: 'loading',
      key: 'loading',
      msj: 'Por favor espere mientras se borra la información...',
      action: 'show',
    });
    if (locationState.edit) {
      confirm({
        title: `¿Está seguro de eliminar la información?`,
        icon: <ExclamationCircleOutlined />,
        content: 'Una vez eliminado, no lo podrá recuperar',
        okText: 'Borrar',
        okType: 'danger',
        cancelText: 'Cancelar',
        onOk() {
          const onHandlerRemove = async () => {
            try {
              await CertsApi.deleteOne(locationState.edit);
              DispatchMessageService({
                key: 'loading',
                action: 'destroy',
              });
              DispatchMessageService({
                type: 'success',
                msj: 'Se eliminó la información correctamente!',
                action: 'show',
              });
              history.push(`${props.matchUrl}`);
            } catch (e) {
              DispatchMessageService({
                key: 'loading',
                action: 'destroy',
              });
              DispatchMessageService({
                type: 'error',
                msj: handleRequestError(e).message,
                action: 'show',
              });
            }
          };
          onHandlerRemove();
        },
      });
    }
  };

  const handleChange = (e: any) => {
    const { name } = e.target;
    const { value } = e.target;
    setCertificado({ ...certificado, [name]: value });
  };

  const getRoles = async () => {
    const data = await RolAttApi.byEvent(props.event._id);
    setRoles(data);
  };

  const onChangeRol = async (e) => {
    setRol(roles.find((rol) => rol?._id === e));
    setCertificado({ ...certificado, rol: roles.find((rol) => rol?._id === e) });
  };

  const chgTxt = (content: any) => {
    let contents = content;
    if (contents === '<p><br></p>') {
      contents = initContent;
    }
    setCertificado({
      ...certificado,
      content: contents,
    });
  };

  const handleImage = (e: any) => {
    const file = e.file;
    if (file) {
      /* console.log(window.URL.createObjectURL(file.originFileObj)); */
      //Si la imagen cumple con el formato se crea el URL para mostrarlo
      setCertificado({ ...certificado, imageFile: window.URL.createObjectURL(file.originFileObj) });
      //Se crea un elemento Image para convertir la image en Base64 y tener el tipo y el formato

      const reader = new FileReader();
      reader.readAsDataURL(file.originFileObj);
      reader.onload = () => {
        const imageData = { data: reader.result, full: file.type, type: file.type.split('/')[1] };
        setCertificado({ ...certificado, imageData: imageData, imageFile: imageData, image: imageData });
      };
    } else {
      DispatchMessageService({
        type: 'error',
        msj: 'Solo se permiten imágenes. Intentalo de nuevo',
        action: 'show',
      });
    }
  };

  const generate = () => {
    console.log(props.event.datetime_from);
    console.log(props.event.datetime_to);
    props.event.datetime_from = dayjs(props.event.datetime_from).format('DD-MM-YYYY');
    props.event.datetime_to = dayjs(props.event.datetime_to).format('DD-MM-YYYY');
    let content = certificado.content;
    const userRef = firestore.collection(`${props.event._id}_event_attendees`);
    userRef
      .orderBy('updated_at', 'desc')
      .limit(1)
      .get()
      .then((querySnapshot) => {
        if (!querySnapshot.empty) {
          const oneUser = querySnapshot.docs[0].data();
          tags.map((item) => {
            let value;
            if (item.tag.includes('event.')) value = props.event[item.value || ''];
            else if (item.tag.includes('ticket.')) value = oneUser.ticket ? oneUser.ticket.title : 'Sin tiquete';
            else if (item.tag.includes('rol.')) {
              const rols = roles.find((rol1) => rol1._id === oneUser.rol_id);
              const rolName = rols ? rols.name.toUpperCase() : 'Sin rol';
              value = rolName;
            } else value = oneUser.properties[item.value || ''];
            if (item.tag) {
              content = content.replace(`[${item?.tag}]`, value);
            }
          });
          setPreviewCert(content);
          /* console.log(content, 'content') */
          const body = {
            content: content,
            image: certificado.imageFile?.data ? certificado.imageFile?.data : certificado.imageFile || imageFile,
          };
          /* console.log(body, 'body') */
          CertsApi.generateCert(body).then((file) => {
            const blob = new Blob([file.blob], { type: file.type, charset: 'UTF-8' });
            // IE doesn't allow using a blob object directly as link href
            // instead it is necessary to use msSaveOrOpenBlob
            if (window.navigator && window.navigator.msSaveOrOpenBlob) {
              window.navigator.msSaveOrOpenBlob(blob);
              return;
            }
            const data = window.URL.createObjectURL(blob);
            const link = document.createElement('a');
            link.dataType = 'json';
            link.href = data;
            link.target = '_blank';
            /* link.download = `certificado${certificado.name}.pdf`; */
            link.dispatchEvent(new MouseEvent('click'));
            setTimeout(() => {
              // For Firefox it is necessary to delay revoking the ObjectURL
              window.URL.revokeObjectURL(data);
            }, 60);
          });
        }
      });
  };

  return (
    <Form onFinish={onSubmit} {...formLayout}>
      <Header
        title="Certificado!"
        description={
          <>
            <ExclamationOutlined
              style={{ color: 'orange' }}
              className="animate__animated animate__pulse animate__infinite"
            />
            {'Para tener una vista más exacta del certificado por favor presione el botón de generar'}
            <br />
            <br />
          </>
        }
        back
        save
        form
        remove={onRemoveId}
        edit={locationState.edit}
        extra={
          <Form.Item>
            <Row wrap gutter={[16, 8]}>
              <Col>
                <Upload type="file" accept="image/*" showUploadList={false} onChange={(e) => handleImage(e)}>
                  <Button type="primary" icon={<UploadOutlined />}>
                    Imagen de Fondo
                  </Button>
                </Upload>
              </Col>
              <Col>
                <Button type="primary" onClick={generate}>
                  Generar
                </Button>
              </Col>
            </Row>
          </Form.Item>
        }
      />

      <Row justify="center" wrap gutter={12}>
        <Col span={20}>
          <Row wrap gutter={[16, 16]}>
            <Col span={12}>
              <Form.Item
                label={
                  <label style={{ marginTop: '2%' }} className="label">
                    Nombre <label style={{ color: 'red' }}>*</label>
                  </label>
                }
                rules={[{ required: true, message: 'El nombre es requerido' }]}
              >
                <Input
                  value={certificado.name}
                  name="name"
                  placeholder="Nombre del certificado"
                  onChange={(e) => handleChange(e)}
                />
              </Form.Item>
            </Col>
            <Col span={12}>
              <Form.Item
                label="Rol"
                /* label={
                  <label style={{ marginTop: '2%' }} className="label">
                    Rol <label style={{ color: 'red' }}>*</label>
                  </label>
                }
                rules={[{ required: true, message: 'El rol es requerido' }]} */
              >
                <Select
                  name="rol"
                  onChange={(e) => {
                    onChangeRol(e);
                  }}
                  placeholder="Seleccione rol"
                  value={certificado.rol?._id || rol?._id}
                >
                  {roles.map((rol) => (
                    <Option key={rol?._id} value={rol?._id}>
                      {rol.name}
                    </Option>
                  ))}
                </Select>
              </Form.Item>
            </Col>
          </Row>
          <Row gutter={[16, 16]}>
            <Col span={16}>
              <Form.Item label="Etiquetas disponibles">
                <p>Use etiquetas para ingresar información referente al curso o los asistentes</p>
                <Row wrap gutter={[18, 8]}>
                  {tags.map((item, key) => (
                    <Col key={key}>
                      <code>{item.tag}</code>
                      <p>{item.label}</p>
                    </Col>
                  ))}
                </Row>
              </Form.Item>
            </Col>
            <Col span={8}>
              <Form.Item
                label="Imagen de Fondo"
                tooltip={
                  <>
                    {'Si desea volver a tener la imagen anterior presione el siguiente botón'}
                    <Button
                      type="primary"
                      onClick={() =>
                        setCertificado({ ...certificado, imageFile: imageFile, imageData: imageFile, image: imageFile })
                      }
                    >
                      Cambiar a Imagen original
                    </Button>
                  </>
                }
              />
              <Image
                src={certificado.imageFile?.data ? certificado.imageFile?.data : certificado.imageFile || imageFile}
                alt="Imagen certificado"
                preview={previewCert}
              />
            </Col>
          </Row>

          <Form.Item label="Certificado">
            <EviusReactQuill name="content" data={certificado.content} handleChange={chgTxt} />
          </Form.Item>
        </Col>
      </Row>
      <BackTop />
    </Form>
  );
};

export default withRouter(CertificateEditor);
